import React from "react";
import { motion } from "framer-motion";
function Tickets() {
  return <motion.div
  initial={{ y: -600 , scale:0 }}
      animate={{ y: 0, scale:1 }}
     
      transition={{
        type: "spring",
        stiffness: 260,
        damping: 20, 
        x:{ duration:0.5 }
      }}>Tickets</motion.div>;
}

export default Tickets;
